///
/// # Examples
///
/// ```
/// use hashbrown::HashMap;
///
/// let mut map: HashMap<String, u32> = HashMap::new();
/// map.entry_ref("poneyland").or_insert(3);
/// // existing key
/// assert_eq!(map.entry_ref("poneyland").key(), "poneyland");
/// // nonexistent key
/// assert_eq!(map.entry_ref("horseland").key(), "horseland");
/// ```

